import React from "react";
import { Nav, LinkContainer } from "react-bootstrap";
import { Link, NavLink } from "react-router-dom";

const CheckoutSteps = ({ step1, step2, step3, step4 }) => {
	return (
		<Nav className="justify-content-center mb-4">
			<Nav.Item>
				{" "}
				{step1 ? (
					<LinkContainer to="/login"> Sign In</LinkContainer>
				) : (
					<NavLink disabled> Sign In</NavLink>
				)}
			</Nav.Item>
			<Nav.Item>
				{" "}
				{step1 ? (
					<LinkContainer to="/shipping"> Shipping</LinkContainer>
				) : (
					<NavLink disabled> Shipping</NavLink>
				)}
			</Nav.Item>
			<Nav.Item>
				{" "}
				{step1 ? (
					<LinkContainer to="/payment"> Payment</LinkContainer>
				) : (
					<NavLink disabled> Payment</NavLink>
				)}
			</Nav.Item>
			<Nav.Item>
				{" "}
				{step1 ? (
					<LinkContainer to="/placeorder"> Place Order</LinkContainer>
				) : (
					<NavLink disabled>Place Order</NavLink>
				)}
			</Nav.Item>
		</Nav>
	);
};

export default CheckoutSteps;
